import '../css/chatNav.css';
import IconButton from '@material-ui/core/IconButton';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import VideocamIcon from '@material-ui/icons/Videocam';
import PhoneIcon from '@material-ui/icons/Phone';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';

export default function ChatNav(props)
{
    const {toggleBackHome,partnerInfo} = props


    return<div className="chatNav-div">
        <div class="head">
        <IconButton i><ArrowBackIcon/></IconButton> 
				<div class="user">
					<div class="avatar">
						<img src="https://picsum.photos/g/40/40" />
					</div>
					<div class="name">Kai Cheng</div>
				</div>
				<ul id="bar_tool">
					<IconButton><span class="alink"><PhoneIcon id="contact"/></span></IconButton>
					<IconButton><span class="alink"><VideocamIcon id="contact"/></span></IconButton>
					<IconButton><span class="alink"><MoreHorizIcon id="contact"/></span></IconButton>
				</ul>
			</div>
    </div>
}
